            type: 'value',
            boundaryGap: [0, '100%'],
            splitLine: {
                show: false
            },
        },
        series: [{
            name: 'Chart',
            type: 'line',
            showSymbol: false,
            hoverAnimation: false,
            data: props.data
        }],


